package ticket.finder.dto;

public class Cs {
	private int csNum;
	private String csTitle;
	private String csContents;
	private String csCategory;
	private int csCount;
	private String csDate;
	
	public Cs() {
		// TODO Auto-generated constructor stub
	}

	public int getCsNum() {
		return csNum;
	}

	public void setCsNum(int csNum) {
		this.csNum = csNum;
	}

	public String getCsTitle() {
		return csTitle;
	}

	public void setCsTitle(String csTitle) {
		this.csTitle = csTitle;
	}

	public String getCsContents() {
		return csContents;
	}

	public void setCsContents(String csContents) {
		this.csContents = csContents;
	}

	public String getCsCategory() {
		return csCategory;
	}

	public void setCsCategory(String csCategory) {
		this.csCategory = csCategory;
	}

	public int getCsCount() {
		return csCount;
	}

	public void setCsCount(int csCount) {
		this.csCount = csCount;
	}

	public String getCsDate() {
		return csDate;
	}

	public void setCsDate(String csDate) {
		this.csDate = csDate;
	}
}
